import React from 'react';
import { AboutContanier } from '../Aboutpage/About.elements';
import { 
    ContactWrap, 
    GetInTouchWrap, 
    GetInTouchHeading } from './Contact.elements';

const Contact = () => {
    return(
        <AboutContanier>
            <ContactWrap>
                <GetInTouchWrap>
                    <GetInTouchHeading>Get In Touch</GetInTouchHeading>
                </GetInTouchWrap>
            </ContactWrap>
        </AboutContanier>
    )
}

export default Contact;
